    console.log(rol);

    console.log(rol);

    if (rol) {
        for (let i = 0; i < rol.length; i++) {
            console.log(rol[i]);

            if (!Roles.includes(rol[i])) {
                /*                 console.log(rol[i]);
                 */
                return res.status(400).json({
                    message: `Role ${rol[i]} no existe`
                })
            }
        }
    }
    next();

};

